create table achievements_templates
(
    Id                        int unsigned              not null
        primary key,
    Name                      varchar(255)              null,
    NameId                    int unsigned              not null,
    CategoryId                int unsigned              not null,
    DescriptionId             int unsigned              not null,
    IconId                    int                       not null,
    Points                    int unsigned              not null,
    Level                     int unsigned              not null,
    `Order`                   int unsigned              not null,
    KamasRatio                float(10, 2) default 0.00 not null,
    ExperienceRatio           float(10, 2) default 0.00 not null,
    KamasScaleWithPlayerLevel tinyint      default 0    not null,
    ObjectiveIdsCSV           mediumtext                not null,
    RewardIdsCSV              mediumtext                not null
)
    engine = MyISAM
    charset = utf8;

